# Buzzer
## 1. Overview
In this lesson you will learn how to connect and use a buzzer.

## 2. Components required

* Development board;
* Breadboard 830p;
* 1 x passive buzzer;
* Diode;
* Transistor;
* 1 x 1000 Ω resistor;
* 7 x male-to-male jumper wires;
* Micro USB – Type A USB cable;

## 3. Components introduction
### Buzzer
A buzzer is an audio signaling device that makes a buzzing sound at different
frequencies. There are two types of buzzers, active and passive. In our project, we use
a passive one. A passive buzzer can make different tones, but it requires a PWM
signal from the device which controls the buzzer, in order to produce a noise.
